import * as S from "./styles";

function ListDetail({ obj = {}, type }) {
  return (
    <S.Container>
      <S.Fullname>{obj.fullName}</S.Fullname>
      <S.Username>{obj.username}</S.Username>
      <S.Password>{obj.password}</S.Password>
      <S.Event>{obj.event}</S.Event>
      <S.Delete></S.Delete>
    </S.Container>
  );
}

export default ListDetail;
